var enamerator = {};
enamerator.defaults = {
	'min': 4,
	'max': 8,
	'prefix': '',
	'gender': 'f'
};
enamerator.setup = function() {
	// setup ui handlers
	document.getElementById('length_range_min').onchange = enamerator.onChangeMin;
	document.getElementById('length_range_max').onchange = enamerator.onChangeMax;
	document.getElementById('logo').onclick = enamerator.toggleAutoScroll;
	// add click handlers to gender radios to update settings link
	var gender_radios = document.getElementsByName('sex');
	for(var i in gender_radios) {
		gender_radios[i].onclick = enamerator.setSettingsLink;
	}
	// add change handler to prefix to update settings link
	document.getElementById('prefix').onchange = enamerator.onChangePrefix;

	document.getElementById('name_output').onscroll = enamerator.onNameScroll;

	// get settings from fragment or defaults
	var hashParams = enamerator.getHashParams();
	var min = hashParams['min'] || enamerator.defaults['min'];
	var max = hashParams['max'] || enamerator.defaults['max'];
	var gender = hashParams['gender'] || enamerator.defaults['gender'];
	var prefix = hashParams['prefix'] || enamerator.defaults['prefix'];

	document.getElementById('length_range_min').value = min;
	// only call handler if modified by has parameter so we don't
	// set the hash if there wasn't one
	if(hashParams.hasOwnProperty('min')) {
		enamerator.onChangeMin();
	}
	document.getElementById('length_range_max').value = max;
	// only call handler if modified by has parameter so we don't
	// set the hash if there wasn't one
	if(hashParams.hasOwnProperty('max')) {
		enamerator.onChangeMax();
	}
	enamerator.setRadioValue('sex', gender);
	document.getElementById('prefix').value = prefix;

	enamerator.constrainPrefixLength();
	enamerator.decompress(enamerator.stats);
	enamerator.addNamesWhileScrolled();
	enamerator.setSettingsLink(false);
};

enamerator.onChangePrefix = function() {
	enamerator.checkPrefixValidity();
	enamerator.setSettingsLink();
};
enamerator.onClickName = function(e) {
	// create element with name
	var element = document.createElement('div');
	// add text to element
	element.innerHTML = e.target.innerHTML;
	// add name to fav list
	document.getElementById('favlist').appendChild(element);
};

enamerator.checkPrefixValidity = function() {
	var pref = document.getElementById('prefix');
	if(!pref.checkValidity()) {
		// find longest prefix that matches
		var val = pref.value;
		var newVal = val.replace(/([A-z]*).*/, '$1');
		pref.value = newVal;
	}
};

enamerator.getCurrentSettings = function() {
	return {
		'min': enamerator.getInputInt(document.getElementById('length_range_min')),
		'max': enamerator.getInputInt(document.getElementById('length_range_max')),
		'gender': enamerator.getRadioValue('sex'),
		'prefix': document.getElementById('prefix').value
	};
};

enamerator.setSettingsLink = function(setFragment) {
	if(setFragment === undefined) setFragment = true;
	var settings = enamerator.getCurrentSettings();
	var sarray = [];
	for(var setting in settings) {
		sarray.push(setting + '=' + settings[setting]);
	}
	var domain = 'http://enamerator.com';
	var linkurl = domain + '#' + sarray.join('&');
	document.getElementById('settings-link').href = linkurl;
	if(setFragment) {
		location.replace('#' + sarray.join('&'));
	}
};

enamerator.getHashParams = function() {
    var hashParams = {};
    var e,
        a = /\+/g,  // Regex for replacing addition symbol with a space
        r = /([^&;=]+)=?([^&;]*)/g,
        d = function (s) { return decodeURIComponent(s.replace(a, " ")); },
        q = window.location.hash.substring(1);

    while (e = r.exec(q))
       hashParams[d(e[1])] = d(e[2]);

    return hashParams;
};
enamerator.decompress = function(stats) {
	// decompress stats
	var genders = ['m', 'f', 'n'];
	for(var g in genders) {
		for(var l in stats[genders[g]]) {
			if(l != 'F') {
				for(var m in stats[genders[g]][l]) {
					if(m != 'F') {
						stats[genders[g]][l][m]['F'] = enamerator.decompressFreq(stats[genders[g]][l][m]['F']);
						stats[genders[g]][l][m]['L'] = enamerator.decompressFreq(stats[genders[g]][l][m]['L']);
					}
				}
			}
		}
	}
};
enamerator.decompressFreq = function(freq) {
	if(!(freq instanceof Array)) {
		var arr = [];
		for(var n in enamerator.letters.split('')) {
			arr.push(freq[enamerator.letters[n]] || 0);
		}
		return arr;
	}
	return freq;
};
enamerator.letters = 'abcdefghijklmnopqrstuvwxyz';
enamerator.constrainPrefixLength = function() {
	var length = enamerator.getInputInt(document.getElementById('length_range_max'));
	document.getElementById('prefix').maxLength = length;
	// shorten prefix if it is currently longer
	document.getElementById('prefix').value = document.getElementById('prefix').value.substr(0, length);
};
enamerator.onChangeMin = function() {
	var min = enamerator.getInputInt(document.getElementById('length_range_min'));
	var max = enamerator.getInputInt(document.getElementById('length_range_max'));
	if(max < min) {
		document.getElementById('length_range_max').value = min;
		document.getElementById('prefix').maxLength = max;
		enamerator.constrainPrefixLength();
	}
	enamerator.setSettingsLink();
};
enamerator.onChangeMax = function() {
	var min = enamerator.getInputInt(document.getElementById('length_range_min'));
	var max = enamerator.getInputInt(document.getElementById('length_range_max'));
	if(max < min) {
		document.getElementById('length_range_min').value = max;
	}
	enamerator.constrainPrefixLength();
	enamerator.setSettingsLink();
};
enamerator.getInputInt = function(element) {
	return parseInt(element.value, 10);
};
enamerator.isScrolledToBottom = function(element) {
	var bufferAmount = document.documentElement.clientWidth <= 443 ? 200 : 10;
	return element.scrollTop + bufferAmount >= element.scrollHeight - element.clientHeight;
};
enamerator.addNamesWhileScrolled = function() {
	while(enamerator.isScrolledToBottom(document.getElementById('name_output'))) {
		var names = enamerator.makeNameFromUI();
		enamerator.addNameToList(names.names[0], names.sex);
	}
};
enamerator.onNameScroll = function() {
	enamerator.addNamesWhileScrolled();
	enamerator.spinLogo();
};
enamerator.spinLogo = function() {
	document.getElementById('logo').style.transform =
		'rotate('+document.getElementById('name_output').scrollTop + 'deg)';
}
enamerator.getRadioValue = function(name) {
	var radios = document.getElementsByName(name);
	if(radios.length == 0) throw 'No elements with name: ' + name;

	for(var i = 0, length = radios.length; i < length; i++) {
		if(radios[i].checked) {
			return radios[i].value;
		}
	}
	throw 'No radio button with name ' + name + ' are checked';
};
enamerator.setRadioValue = function(name, value) {
	var radios = document.getElementsByName(name);
	if(radios.length == 0) throw 'No elements with name: ' + name;

	for(var i = 0, length = radios.length; i < length; i++) {
		if(radios[i].value === value) {
			radios[i].checked = true;
			return;
		}
	}
	throw 'No radio button with name ' + name + ' are checked';
}
enamerator.makeNameFromUI = function() {
	var sex = enamerator.getRadioValue('sex');
	var length;
	var length_min = parseInt(document.getElementById('length_range_min').value, 10);
	var length_max = parseInt(document.getElementById('length_range_max').value, 10);
	if(length_max < length_min) {
		length_max = length_min;
	}
	length = enamerator.getRandomInt(length_min, length_max);
	var prefix = document.getElementById('prefix').value;
	return enamerator.makeNames(enamerator.stats, length, 1, sex, prefix);
};
enamerator.makeNames = function(stats, len, count, gender, prefix) {
	if(count === undefined) count = 1;
	var un = null;
	if(gender[0] === 'n') {
		un = stats['n'];
	} else if(gender[0] === 'm') {
		un = stats['m'];
	} else {
		un = stats['f'];
	}
	var names = [];
	for(var i = 0; i < count; i++) {
		names.push(enamerator.onename(un, len, prefix))
	}
	return {sex: gender, names: names};
};
// Returns a random integer between min and max
enamerator.getRandomInt = function(min, max) {
	return Math.floor(Math.random() * (max - min + 1) + min);
};
enamerator.getNormal = function() {
	return (Math.random() + Math.random() + Math.random() + Math.random() + Math.random() + Math.random()) / 6 - 0.5;
};
enamerator.sum = function(arr) {
	var sum = 0;
	for(var i in arr) {
		sum = sum + arr[i];
	}
	return sum;
};
// sample from data with probabilities specified by prob
// prob neet not sum to 1 but must be non-negative values
enamerator.sample = function(data, prob) {
	if(prob !== undefined && data.length != prob.length) {
		throw 'Data (' + data.length + ') and probability weights (' + prob.length + ') must be same length';
	}
	if(prob === undefined || enamerator.sum(prob) == 0) {
		return data[enamerator.getRandomInt(0, data.length)];
	}
	var cum = [prob[0]];
	for(var i = 1; i < data.length; i++) {
		cum.push(cum[i-1] + prob[i]);
	}
	var r = Math.random() * cum[cum.length - 1];
	var index = 0;
	for(index = 0; cum[index] < r; index++) {
	}
	return data[index];
};
enamerator.onename = function(ngram, len, prefix) {
	prefix = prefix.toLowerCase();
	// TODO error if prefix.length > len
	var remaining = len;
	if(remaining === undefined) {
		// todo magic numbers to define range of name lengths
		remaining = enamerator.getRandomInt(4,8);
	}
	var name;
	if(prefix != undefined) {
		name = prefix;
		remaining = remaining - prefix.length;
	}
	// generate first letter based on frequency
	if(remaining == len) {
		name = enamerator.sample(enamerator.letters, ngram['F']);
		remaining--;
	}
	// generate second letter based on previous unigram
	if(remaining == len - 1) {
		name = name.concat(enamerator.sample(enamerator.letters, ngram[name[name.length - 1]]['F']));
		remaining--;
	}
	// generate remaining letters based on previous bigrams, except for last
	while(remaining > 1) {
		name = name.concat(enamerator.sample(enamerator.letters, ngram[name[name.length - 2]][name[name.length - 1]]['F']))
		remaining--;
	}
	// add last letter based on last letter frequencies
	if(remaining > 0) {
		name = name.concat(enamerator.sample(enamerator.letters, ngram[name[name.length - 2]][name[name.length - 1]]['L']))
		remaining--;
	}
	return name[0].toUpperCase() + name.substr(1);
};
enamerator.addNameToList = function(name, sex) {
	// create the dom element
	var element = document.createElement('div');
	// create inner element
	var inner = document.createElement('div');
	// add inner to outer
	element.appendChild(inner);
	// add text
	inner.appendChild(document.createTextNode(name));
	// set sex class
	inner.className = sex + ' name';
	// inner.style.left = enamerator.getRandomInt(0,100) + '%';
	// inner.style.left = (5*enamerator.getNormal()) + 50 + '%';
	inner.onclick = enamerator.onClickName;
	// document.getElementById('name_output').appendChild(element);
	document.getElementById('name_output').insertBefore(element, document.getElementById('scroll-buffer'));
};
enamerator.timeoutId = -1;
enamerator.toggleAutoScroll = function() {
	if (enamerator.timeoutId === -1) {
		enamerator.startAutoScroll();
	} else {
		enamerator.stopAutoScroll();
	}
};
enamerator.startAutoScroll = function() {
	document.getElementById('logo').style.cursor = 'url(img/stop-cursor.png), auto';
	enamerator.timeoutId = window.setInterval(function() {
		var name_output = document.getElementById('name_output');
		name_output.scrollTop = name_output.scrollTop + 1;
	}, 10);
};
enamerator.stopAutoScroll = function() {
	document.getElementById('logo').style.cursor = 'url(img/play-cursor.png), auto';
	window.clearInterval(enamerator.timeoutId);
	enamerator.timeoutId = -1;
};
